    // Figure out which character to use
    vec2 char_size = vec2(8.0, 16.0);
    vec2 uv = (floor(fragCoord / char_size) * char_size);
	vec2 in_char_uv = fragCoord - uv;
    uv /= iResolution.xy;

    vec3 col = vec3(0.0);
    float weights = 0.0;
    for(float x = 0.0; x < char_size.x; x += 1.0) {
        for(float y = 0.0; y < char_size.y; y += 1.0) {
        	float weight = length(vec2(x, y) - char_size / 2.0);
            col += texture(iChannel0, uv + vec2(x, y) / iResolution.xy).rgb * weight;
            weights += weight;
        }
    }
    col = col / weights;

    termchar best_char;
    float best_dist = 1000000000.0;

    for(int i = 0; i < 528; i++) {
   		float dist = labDist(col, full_palette[i].col);
        if(dist < best_dist) {
        	best_char = full_palette[i];
            best_dist = dist;
        }
    }

    // Draw character
   	float fore_back = 1.0;
    if(best_char.char == 1) {
    	fore_back = mod(1.0 + in_char_uv.x + mod(in_char_uv.y, 2.0), 2.0);
    }
    if(best_char.char == 2) {
    	fore_back = mod(1.0 + in_char_uv.x + mod(in_char_uv.y, 2.0) * 2.0, 4.0);
    }
    fore_back = floor(fore_back);

    vec3 pixel_col = fore_back * best_char.fore + (1.0 - fore_back) * best_char.back;
    fragColor = vec4(pixel_col, 1.0);

}
